import React, { useState } from 'react';
import * as api from '../utils/api';

export default function TestConnection() {
    const [testResults, setTestResults] = useState({});
    const [loading, setLoading] = useState(false);

    const testDatabaseConnection = async () => {
        setLoading(true);
        try {
            const response = await api.apiClient.get('/test/db-connection');
            setTestResults(prev => ({
                ...prev,
                database: { success: true, data: response.data }
            }));
        } catch (error) {
            setTestResults(prev => ({
                ...prev,
                database: { 
                    success: false, 
                    error: error.response?.data?.message || error.message 
                }
            }));
        }
        setLoading(false);
    };

    const testHealthCheck = async () => {
        setLoading(true);
        try {
            const response = await api.apiClient.get('/test/health');
            setTestResults(prev => ({
                ...prev,
                health: { success: true, data: response.data }
            }));
        } catch (error) {
            setTestResults(prev => ({
                ...prev,
                health: { 
                    success: false, 
                    error: error.response?.data?.message || error.message 
                }
            }));
        }
        setLoading(false);
    };

    const testRegistration = async () => {
        setLoading(true);
        try {
            const testUser = {
                username: 'testuser' + Date.now(),
                email: 'test' + Date.now() + '@example.com',
                fullName: 'Test User',
                password: 'password123',
                role: 'STUDENT'
            };

            const response = await api.register(testUser);
            setTestResults(prev => ({
                ...prev,
                registration: { success: true, data: response.data }
            }));
        } catch (error) {
            setTestResults(prev => ({
                ...prev,
                registration: { 
                    success: false, 
                    error: error.response?.data?.message || error.message 
                }
            }));
        }
        setLoading(false);
    };

    return (
        <div style={{ padding: '20px', maxWidth: '800px', margin: '0 auto' }}>
            <h2>Connection Test Dashboard</h2>

            <div style={{ marginBottom: '20px' }}>
                <button onClick={testHealthCheck} disabled={loading}>
                    Test Health Check
                </button>
                <button onClick={testDatabaseConnection} disabled={loading} style={{ marginLeft: '10px' }}>
                    Test Database Connection
                </button>
                <button onClick={testRegistration} disabled={loading} style={{ marginLeft: '10px' }}>
                    Test Registration
                </button>
            </div>

            {loading && <p>Testing...</p>}

            <div style={{ marginTop: '20px' }}>
                {testResults.health && (
                    <div style={{ marginBottom: '15px', padding: '10px', border: '1px solid #ccc' }}>
                        <h3>Health Check</h3>
                        <p>Status: {testResults.health.success ? '✅ Success' : '❌ Failed'}</p>
                        {testResults.health.success ? (
                            <pre>{JSON.stringify(testResults.health.data, null, 2)}</pre>
                        ) : (
                            <p style={{ color: 'red' }}>Error: {testResults.health.error}</p>
                        )}
                    </div>
                )}

                {testResults.database && (
                    <div style={{ marginBottom: '15px', padding: '10px', border: '1px solid #ccc' }}>
                        <h3>Database Connection</h3>
                        <p>Status: {testResults.database.success ? '✅ Success' : '❌ Failed'}</p>
                        {testResults.database.success ? (
                            <pre>{JSON.stringify(testResults.database.data, null, 2)}</pre>
                        ) : (
                            <p style={{ color: 'red' }}>Error: {testResults.database.error}</p>
                        )}
                    </div>
                )}

                {testResults.registration && (
                    <div style={{ marginBottom: '15px', padding: '10px', border: '1px solid #ccc' }}>
                        <h3>Registration Test</h3>
                        <p>Status: {testResults.registration.success ? '✅ Success' : '❌ Failed'}</p>
                        {testResults.registration.success ? (
                            <pre>{JSON.stringify(testResults.registration.data, null, 2)}</pre>
                        ) : (
                            <p style={{ color: 'red' }}>Error: {testResults.registration.error}</p>
                        )}
                    </div>
                )}
            </div>
        </div>
    );
}
